  [],\n\t\"revision_timestamp\": \"2016-05-31T01:07:49.123262\",\n\t\"name\": \"marine-mammal-food-habits-reference-collections\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Mammal Laboratory (NMML)
  Food Habits Reference Collection, containing over 8000 specimens of cephalopod beaks
  and fish bones and otoliths, is used to identify undigested prey remains found in
  scats or stomachs of stranded or incidentally taken pinnipeds and cetaceans. Within
  this collection, 275 species of fish and over 100 species of cephalopods are represented.
  \ Marine mammal food habits data are used in conjunction with satellite telemetry
  and dive records to better understand foraging behavior and prey selection. This
  information is critical to understanding how commercial fisheries and changing environmental
  conditions impact these animals.nnThe Food Habits Collection includes fish and cephalopod
  species that are commonly consumed by pinnipeds along the Pacific Northwest coast
  and in Alaska, but we are in the process of adding other potential prey species
  and specimens to fill unrepresented size ranges.  We are very appreciative of NMFS/AFSC/RACE
  fisheries biologists, the Alaska Department of Fish and Game and the University
  of Washington for their ongoing donations to our collection.  With the help and
  cooperation of researchers such as these, our collection continues to grow in size
  and usefulness.nnThe Marine Mammal Food Habits Reference Collection is an important
  research tool within NMML, and is also used several times a year by graduate students
  and researchers from universities, government agencies and private institutions.
  \ These collections have contributed to food habits research on Magister armhook
  squid, Northern fulmar, Newells shearwater, Hawaiian petrel, river otters and marine
  mammals.  The collections are also used by archeologists to identify fish and mammal
  bones found in Native American middens from Alaska to Mexico. nnThe database is
  comprised of three tables, detailing specimens and associated data and measurements
  for fish and cephalopod soft tissue and hard parts contained within the reference
  collection.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
